import React, { Component } from 'react';
import './RegisterCustomers.css'
export default class RegisterCustomers extends Component {
  toPass() {

      this.props.history.push("/login");
 }

    render() {

        return (
      <div className="background-register">
        <div className="login">
          <fieldset>
            <legend>Preencha os dados para Login</legend>
            <legend className="datas-to-login">Nome</legend>
            <input placeholder="Digite aqui seu nome" type="text" />
            <legend className="datas-to-login">Idade</legend>
            <input placeholder="Digite aqui sua Idade" type="password" />
            <legend className="datas-to-login">Email</legend>
            <input placeholder="Digite aqui seu email" type="password" />
            {/* <Link className="to-costumer-base" to="/customers"> */}
              <a onClick={() =>this.toPass()} >Cadastrar Usu√°rio</a>
            {/* </Link> */}
          </fieldset>
        </div>
      </div>
        )
    }
}
